import React from "react";
import { Link } from "react-router-dom";
import Modal3 from "./modal/Modal3";

class Step3 extends React.Component {
  render() {
    return (
      <>
        <Modal3 />
        <Link to={`/generate/`}>
          <div >
            絵を作成する
          </div>
        </Link>
      </>
    );
  }
}

export default Step3;
